import React from "react";

import "./footer.css";
import {Container, Row, Col, ListGroup, ListGroupItem} from "reactstrap";
import {Link} from "react-router-dom";
import logo from "../../assets/images/logo.png";

const quick__links = [
    {
        path:'/home',
        display:'Home'
    },
    {
        path:'/about',
        display:'About'
    },
    {
        path:'/entreprises',
        display:'Services'
    },
];

const quick__links2 = [
    {
        path:'/home',
        display:'Home'
    },
    {
        path:'/about',
        display:'About'
    },
    {
        path:'/entreprises',
        display:'Services'
    },
]

const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <col lg="3"></col>
                </Row>
            </Container>
        </footer>

    );

};
export default Footer;
